void coordinate_comp(int a[],int n){
  int i,c=0;
  sd dat[524288];
  for(i=0;i<n;i++){
    dat[i].val=a[i];
    dat[i].node=i;
  }
  qsort(dat,n,sizeof(dat[0]),sdsortfnc);
  a[dat[0].node]=c;
  for(i=1;i<n;i++){
    if(dat[i-1].val!=dat[i].val){c++;}
    a[dat[i].node]=c;
  }
}

int n;

void cvrt(char s[],int a[]){
  int i;
  for(i=0;i<n;i++){
    a[i]=s[i]-'0';
  }
}

// A moves [-bk,fw]
// B affects A[-fw,bk]
void mngfl(int a[],int res[],int bk,int fw){
  int i,j,mem[8192];
  for(i=0;i<3*n;i++){mem[i]=0;}
  for(i=0;i<n;i++){
    res[i]=0;
    if(a[i]==0){continue;}
    mem[n+i-fw]++;
    mem[n+i+bk+1]--;
  }
  for(i=0;i<3*n;i++){
    if(mem[i]!=0){res[i%n]=1;}
    mem[i+1]+=mem[i];
  }
}

int judge(int fl[],int a[],int b[],int del){
  int i,c=0,v;
  for(i=0;i<n;i++){
    v=(n+i+del)%n;
    if(fl[i]==0 && a[i]!=b[v]){return -1;}
    if(a[i]!=b[v]){c++;}
  }
  return c;
}

